import React, { useState, useEffect } from "react";
import {
  Box,
  Button,
  Typography,
  List,
  ListItem,
  ListItemText,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Divider,
  CircularProgress,
} from "@mui/material";
import API from "../api";

const TrackActivities = () => {
  const [courses, setCourses] = useState([]);
  const [selectedCourse, setSelectedCourse] = useState(null);
  const [currentPDFIndex, setCurrentPDFIndex] = useState(0);
  const [enrolledUsers, setEnrolledUsers] = useState([]);
  const [open, setOpen] = useState(false);
  const [loading, setLoading] = useState(true); // State to track loading

  useEffect(() => {
    fetchCourses();
  }, []);

  const fetchCourses = async () => {
    try {
      const { data } = await API.get("/courses");
      setCourses(data);
    } catch (error) {
      alert("Error fetching courses");
    }
  };

  const fetchEnrolledUsers = async (courseId) => {
    try {
      const { data } = await API.get(`/courses/${courseId}/enrolled-users`);
      setEnrolledUsers(data);
    } catch (error) {
      alert("Error fetching enrolled users");
    }
  };

  const handleCourseSelect = (course) => {
    setSelectedCourse(course);
    setCurrentPDFIndex(0);
    fetchEnrolledUsers(course._id);
    setLoading(true); // Set loading to true when switching PDFs
    setOpen(true);
  };

  const handleCloseDialog = () => {
    setOpen(false);
  };

  const handleNextPDF = () => {
    if (currentPDFIndex < selectedCourse.pdfFiles.length - 1) {
      setLoading(true); // Set loading to true when switching PDFs
      setCurrentPDFIndex(currentPDFIndex + 1);
    }
  };

  const handlePreviousPDF = () => {
    if (currentPDFIndex > 0) {
      setLoading(true); // Set loading to true when switching PDFs
      setCurrentPDFIndex(currentPDFIndex - 1);
    }
  };

  const handlePDFLoad = () => {
    setLoading(false); // Set loading to false when the PDF is fully loaded
  };

  return (
    <Box>
      <Typography variant="h5" gutterBottom>
        Track Activities
      </Typography>

      <List>
        {courses.map((course) => (
          <ListItem
            button
            key={course._id}
            onClick={() => handleCourseSelect(course)}
          >
            <ListItemText primary={course.title} />
          </ListItem>
        ))}
      </List>

      {selectedCourse && (
        <Dialog
          open={open}
          onClose={handleCloseDialog}
          fullWidth
          maxWidth="lg"
        >
          <DialogTitle>{selectedCourse.title}</DialogTitle>
          <DialogContent>
            <Box sx={{ display: "flex", flexDirection: "column", gap: 2 }}>
              <Typography variant="h6">PDF Viewer</Typography>
              {loading && (
                <Box
                  sx={{
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                    height: "500px",
                  }}
                >
                  <CircularProgress />
                </Box>
              )}
              <iframe
                src={selectedCourse.pdfFiles[currentPDFIndex]}
                title={`PDF ${currentPDFIndex + 1}`}
                width="100%"
                height="500px"
                style={{
                  border: "none",
                  display: loading ? "none" : "block",
                }}
                onLoad={handlePDFLoad}
              ></iframe>
              <Box sx={{ display: "flex", justifyContent: "space-between" }}>
                <Button
                  disabled={currentPDFIndex === 0}
                  onClick={handlePreviousPDF}
                  variant="contained"
                >
                  Previous
                </Button>
                <Button
                  disabled={
                    currentPDFIndex === selectedCourse.pdfFiles.length - 1
                  }
                  onClick={handleNextPDF}
                  variant="contained"
                >
                  Next
                </Button>
              </Box>
              <Divider sx={{ my: 2 }} />
              <Typography variant="h6">Enrolled Users</Typography>
              <List>
                {enrolledUsers.map((user) => (
                  <ListItem
                    key={user._id}
                    sx={{ display: "flex", justifyContent: "space-between" }}
                  >
                    <ListItemText
                      primary={`${user.name} (${user.email})`}
                      secondary={`Status: ${
                        user.completed ? "Completed" : "In Progress"
                      }`}
                    />
                  </ListItem>
                ))}
              </List>
            </Box>
          </DialogContent>
          <DialogActions>
            <Button onClick={handleCloseDialog} color="error" variant="outlined">
              Close
            </Button>
          </DialogActions>
        </Dialog>
      )}
    </Box>
  );
};

export default TrackActivities;
